import fetch from 'isomorphic-unfetch';
import { useState, useEffect } from 'react';
import Dashboard from '../components/Dashboard/Dashboard';

const Listings = ({listings})=>{
    let userListings, otherListings;
    const [toggleStatus, toggle] = useState('userListings');
    const [testUser] = useState('abgfigu143668');
    for (const listing in listings) {
        if(listing === testUser){
            userListings = listing.listings;
        }else{
            otherListings = listing.listings;
        }
    }
    return <Dashboard pageTitle="Listings - EazyRent" route="listings" toggle={toggle} listings={listings}/>;
}

Listings.getInitialProps = async()=>{
    const res = await fetch('http://localhost:3004/users');
    const data = await res.json();

    return {
        listings: data
    }
}

export default Listings;
